svg.script:

		var transMatrix = [1,0,0,1,0,0];
        var panRatio;
        function init(evt)
        {
            if ( window.svgDocument == null )
            {
                svgDoc = evt.target.ownerDocument;

            }
            mapMatrix = svgDoc.getElementById("map-matrix");
            width  = evt.target.getAttributeNS(null, "width");
            height = evt.target.getAttributeNS(null, "height");
			console.log(width);
			console.log(height);
			panRation = 1;
        }

        function pan(dx, dy)
        {

			transMatrix[4] += dx;
			transMatrix[5] += dy;

			newMatrix = "matrix(" +  transMatrix.join(' ') + ")";
			mapMatrix.setAttributeNS(null, "transform", newMatrix);
        }

		function zoom(scale,x)
		{
			if(x==1){
				panRation=panRation-2;
			}
			else{
				panRation=panRation+2;
			}
			console.log(panRation);
			for (var i=0; i<transMatrix.length; i++)
			{
				transMatrix[i] *= scale;
			}
			transMatrix[4] += (1-scale)*width/2;
			transMatrix[5] += (1-scale)*height/2;

			newMatrix = "matrix(" +  transMatrix.join(' ') + ")";
			mapMatrix.setAttributeNS(null, "transform", newMatrix);
        }
		function reset(){
			panRation=1;
			console.log(panRation);
			transMatrix = [1,0,0,1,0,0];
			mapMatrix.setAttributeNS(null, "transform", "matrix(1 0 0 1 0 0)");
		}

    var selectedElement = 0;
    var currentX = 0;
    var currentY = 0;
    var currentMatrix = 0;

    function selectElement(evt) {
      selectedElement = evt.target;
	  console.log(selectedElement);
      currentX = evt.clientX;
      currentY = evt.clientY;
	  console.log(document.getElementById("map-matrix").getAttribute("transform"));
      currentMatrix = document.getElementById("map-matrix").getAttribute("transform").slice(7,-1).split(' ');

      for(var i=0; i<currentMatrix.length; i++) {
        currentMatrix[i] = parseFloat(currentMatrix[i]);
      }

      document.getElementById("svg1926").setAttributeNS(null, "onmousemove", "moveElement(evt)");
      document.getElementById("svg1926").setAttributeNS(null, "onmouseout", "deselectElement(evt)");
      document.getElementById("svg1926").setAttributeNS(null, "onmouseup", "deselectElement2(evt)");
    }

    function moveElement(evt) {

      var dx = evt.clientX - currentX;
      var dy = evt.clientY - currentY;
      currentMatrix[4] += dx;
      currentMatrix[5] += dy;

      document.getElementById("map-matrix").setAttributeNS(null, "transform", "matrix(" + currentMatrix.join(' ') + ")");
      currentX = evt.clientX;
      currentY = evt.clientY;
    }

    function deselectElement(evt) {

		  selectElement(evt);
        }
    function deselectElement2(evt) {
	if(selectedElement != 0){
          document.getElementById("svg1926").removeAttributeNS(null, "onmousemove");
          document.getElementById("svg1926").removeAttributeNS(null, "onmouseout");
          document.getElementById("svg1926").removeAttributeNS(null, "onmouseup");
          selectedElement = 0;
          }

	}
